// hooks/useWebGazer.js
import { useEffect } from 'react';

const useWebGazer = (onGaze) => {
  useEffect(() => {
    const initializeWebGazer = () => {
      window.webgazer
        .setGazeListener((data, elapsedTime) => {
          if (data) {
            onGaze(data, elapsedTime);
          }
        })
        .begin();
    };

    initializeWebGazer();

    return () => {
      window.webgazer.end();
    };
  }, [onGaze]);
};

export default useWebGazer;
